<template>
	<nav>
		<v-app-bar text app color="#ededed" class="elevation-0">

			<!-- Snackbar -->
			<v-snackbar
				v-model="snackbar"
				:timeout="this.$store.state.SnackbarTimeout"
				:color="snackbarColor">
				{{ snackbarMessage }}
			</v-snackbar>

			<!-- Burger Menu -->
			<v-app-bar-nav-icon
				color="red"
				dark @click.stop="drawer = !drawer">
			</v-app-bar-nav-icon>

			<!-- Selected Prospect Name and Selector -->
			<span v-if="this.$store.state.SelectedProspect !== ''">
				<v-icon class="ml-2 mr-1" small>
					mdi-account-star
				</v-icon>

				<v-tooltip bottom>
					<template v-slot:activator="{ on, attrs }">
						<span v-bind="attrs" v-on="on">
							<small class="pl-2" @click="openProspectSelectorDialog">
								{{ `${$store.state.ProspectName} (${$store.state.ProspectEmail})` }}
							</small>
						</span>
					</template>
					<span>{{ `${$store.state.ProspectName} (${$store.state.ProspectEmail})` }}</span>
				</v-tooltip>
			</span>

			<!-- Prospect Selector Dialog -->
			<v-dialog v-model="prospectSelectorDialog" max-width="500" persistent scrollable>
				<v-card>
					<v-card-title class="headline black lighten-1 white--text" primary-title>
						<v-icon class="pr-4" color="white">
							mdi-cube-outline
						</v-icon>
						Select a Prospect
						<v-spacer></v-spacer>
						<v-btn icon @click="sweepstakesSelectorDialog = false" color="red">
							<v-icon>
								mdi-close
							</v-icon>
						</v-btn>
					</v-card-title>

					<v-card-text class="pa-10">
						<p>These are your available sweepstakes, select one from the list to switch to the new environment.</p>
						<v-select
							ref="sweepstakesSelector"
							v-model="sweepstakesSelector"
							:items="sweepstakesList"
							item-text="Name"
							item-value="Token"
							filled outlined autofocus
							return-object
							@change="switchSweepstakes($event)">
						</v-select>
					</v-card-text>
				</v-card>
			</v-dialog>

			<!-- Spacer -->
			<v-spacer></v-spacer>

			<!-- Search Icon -->
			<v-menu right bottom v-if="this.$store.state.UserType === 2">
				<template v-slot:activator="{ on }">
					<v-btn right icon v-on="on" @click="fetchGlobalWinners">
						<v-icon>
							mdi-magnify
						</v-icon>
					</v-btn>
				</template>
			</v-menu>

			<!-- Global Search Winners Dialog -->
			<v-dialog v-model="globalSearchDialog" max-width="1200" persistent scrollable>
				<v-card>
					<v-card-title class="headline black lighten-1 white--text" primary-title>
						<v-icon class="pr-3" color="white">
							mdi-magnify
						</v-icon>
						Search Winners
						<v-spacer></v-spacer>
						<v-btn icon @click="globalSearchDialog = false" color="red">
							<v-icon>
								mdi-close
							</v-icon>
						</v-btn>
					</v-card-title>

					<v-card-text class="pa-8">

						<!-- Search Field -->
						<v-text-field
							class="mb-5 mr-2"
							ref="searchField"
							v-model="search"
							append-icon="mdi-magnify"
							label="Search ... "
							single-line
							outlined
							autofocus
							clearable>
						</v-text-field>

						<!-- Datatable -->
						<v-data-table
							:headers="headers"
							:items="winnersList"
							:items-per-page="itemsPerPageSearch"
							:search="search"
							:loading="loadingDatatable"
							:multi-sort="true"
							:footer-props="{'items-per-page-options': [-1, 10, 25, 50, 100, 500]}"
							@update:items-per-page="setDTItemsPerPage('WinnersSearch', $event)">

							<!-- First Name -->
							<template v-slot:item.FirstName="{ item }">

								<span v-if="item.Muted === true && item.Repeated === true">
									<v-tooltip bottom>
										<template v-slot:activator="{ on, attrs }">
											<v-icon small class="mr-1" color="red" v-bind="attrs" v-on="on">
												mdi-bell-off-outline
											</v-icon>
										</template>
										<span>This winner is muted and won't receive notifications</span>
									</v-tooltip>

									<v-tooltip bottom>
										<template v-slot:activator="{ on, attrs }">
											<v-icon small class="mr-1" v-bind="attrs" v-on="on">
												mdi-seal
											</v-icon>
										</template>
										<span>This winner exists in another sweepstakes</span>
									</v-tooltip>

									{{ item.FirstName }}
								</span>

								<span v-if="item.Muted === true && item.Repeated === false">
									<v-tooltip bottom>
										<template v-slot:activator="{ on, attrs }">
											<v-icon small class="mr-1" color="red" v-bind="attrs" v-on="on">
												mdi-bell-off-outline
											</v-icon>
										</template>
										<span>This winner is muted and won't receive notifications</span>
									</v-tooltip>

									{{ item.FirstName }}
								</span>

								<span v-if="item.Muted === true && item.Repeated === undefined || item.Repeated === null">
									<v-tooltip bottom>
										<template v-slot:activator="{ on, attrs }">
											<v-icon small class="mr-1" color="red" v-bind="attrs" v-on="on">
												mdi-bell-off-outline
											</v-icon>
										</template>
										<span>This winner is muted and won't receive notifications</span>
									</v-tooltip>

									{{ item.FirstName }}
								</span>

								<span v-if="item.Muted === false && item.Repeated === true">
									<v-tooltip bottom>
										<template v-slot:activator="{ on, attrs }">
											<v-icon small class="mr-1" v-bind="attrs" v-on="on">
												mdi-seal
											</v-icon>
										</template>
										<span>This winner exists in another sweepstakes</span>
									</v-tooltip>

									{{ item.FirstName }}
								</span>

								<!-- First Name -->
								<span v-if="item.Muted === false && item.Repeated === false">
									{{ item.FirstName }}
								</span>

								<!-- Last Name -->
								<span v-if="item.Muted === false && item.Repeated === undefined || item.Repeated === null">
									{{ item.FirstName }}
								</span>

							</template>

							<!-- Phone Number -->
							<template v-slot:item.MobileNumber="{ item }">
								{{ formatPhoneNumber(item.MobileNumber) }}
							</template>

							<!-- Sweepstakes Name -->
							<template v-slot:item.Sweepstakes="{ item }">

								<div v-if="item.ArchivedSweeps">
									<v-tooltip bottom>
										<template v-slot:activator="{ on, attrs }">
											<v-icon small class="mr-1" v-bind="attrs" v-on="on">
												mdi-archive-outline
											</v-icon>
										</template>
										<span>This sweepstakes is archived</span>
									</v-tooltip>
									{{ item.Sweepstakes }}
								</div>

								<div v-if="!item.ArchivedSweeps">
									{{ item.Sweepstakes }}
								</div>

							</template>
						</v-data-table>
					</v-card-text>
				</v-card>
			</v-dialog>

			<!-- My Account Icon -->
			<v-menu right bottom>

				<template v-slot:activator="{ on }">
					<v-btn right icon @click="() => on = true">
						<v-icon>
							mdi-account-circle
						</v-icon>
					</v-btn>
				</template>

				<v-list>

					<v-list-item link :to="{ path: '/profile' }">
						<v-icon class="mr-2">
							mdi-face-man-profile
						</v-icon>
						<v-list-item-title>
							Profile
						</v-list-item-title>
					</v-list-item>

					<v-list-item link :to="{ path: '/users' }" v-if="this.$store.state.UserType === 2">
						<v-icon class="mr-2">
							mdi-account-multiple
						</v-icon>
						<v-list-item-title>
							Users
						</v-list-item-title>
					</v-list-item>

					<!-- <v-list-item link :to="{ path: '/settings' }">
						<v-icon class="mr-2">
							mdi-tune
						</v-icon>
						<v-list-item-title>Settings</v-list-item-title>
					</v-list-item> -->

					<v-divider></v-divider>

					<v-list-item link @click="destroySession">
						<v-icon class="mr-2">
							mdi-logout-variant
						</v-icon>
						<v-list-item-title>
							Logout
						</v-list-item-title>
					</v-list-item>

				</v-list>
			</v-menu>

		</v-app-bar>

		<!-- Navigation Drawer -->
		<v-navigation-drawer v-model="drawer" app>

			<!-- Sweeppea Logo -->
			<img class="pt-8 pl-7 pb-4" src="data:image/png;base64," width="180">

			<v-divider></v-divider>

			<v-list dense nav class="pa-5">

				<!-- Dashboard -->
				<v-list-item :to="{ path: '/dashboard' }">
					<v-list-item-content>
						<v-list-item-title>
              <v-icon>
                mdi-view-dashboard
              </v-icon>
							Dashboard
						</v-list-item-title>
					</v-list-item-content>
				</v-list-item>

				<!-- Prospects (only admins) -->
				<v-list-item v-if="this.$store.state.UserType === 3" :to="{ path: '/prospects' }">
					<v-list-item-content>
						<v-list-item-title>
            <v-icon>
							mdi-account-star
						</v-icon>
							Prospects
						</v-list-item-title>
					</v-list-item-content>
				</v-list-item>

				<!-- Proposals -->
				<v-list-item :to="{ path: '/proposals' }">
					<v-list-item-content>
						<v-list-item-title>
              <v-icon>
							  mdi-cube-outline
						  </v-icon>
							Proposals
						</v-list-item-title>
					</v-list-item-content>
				</v-list-item>

				<!-- Blocks Library (only admins) -->
				<v-list-item v-if="this.$store.state.UserType === 3" :to="{ path: '/library' }">
					<v-list-item-content>
						<v-list-item-title>
              <v-icon>
                mdi-library
              </v-icon>
							Library
						</v-list-item-title>
					</v-list-item-content>
				</v-list-item>

			</v-list>
		</v-navigation-drawer>
	</nav>

</template>

<script>
import moment from 'moment';

/* Supress Moment Deprecation Warnings */
moment.suppressDeprecationWarnings = true;

/* Supress Moment Deprecation Warnings */
moment.suppressDeprecationWarnings = true;

export default {

	name: 'NavigationBars',

	data() {

		return {

			/* Error Dialog */
			errorAlert: false,
			errorMessage: '',

			/* Snackbar */
			snackbar: false,
			snackbarMessage: '',
			snackbarColor: 'success',

			/* Dialogs */
			prospectSelectorDialog: false,

			drawer: null,
			globalSearchDialog: false,

			/* Search */
			search: '',
			showSearchField: true,
			magnifyIcon: 'mdi-magnify',

			/* Datatables */
			headers: [
				{ text: 'Name', align: 'left', value: 'FirstName', sortable: true, width: '15%' },
				{ text: 'Last Name', align: 'left', value: 'LastName', sortable: true, width: '15%' },
				{ text: 'Email', align: 'left', value: 'Email', sortable: true, width: '22%' },
				{ text: 'Phone', align: 'left', value: 'MobileNumber', sortable: true, width: '13%' },
				{ text: 'Sweepstakes', align: 'left', value: 'Sweepstakes', sortable: true, width: '35%' },
			],
			loadingDatatable: false,
			winnersList: [],
			itemsPerPageSearch: null,
			sweepstakesSelectorDialog: false,
			sweepstakesSelector: '',
			sweepstakesList: [],
		}
	},

	methods: {

		destroySession() {

			/* Clear Session Storage */
			sessionStorage.clear();
			localStorage.removeItem('OvSessToken');

			/* Redirect to Login Page */
			this.$router.push({ path: '/' });
		},
	},

	/* Component Lifecycle
	/
	/  beforeCreate()
	/  created()
	/  beforeMount()
	/  mounted()
	/  beforeUpdate()
	/  updated()
	/  beforeDestroy()
	/  destroyed()
	*/

	created() {
		/* Recreate Store on Reload */
		this.$store.dispatch('fetchInfoSettings');
	}
}
</script>
